def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        if item > bins[i]:
            priorities[i] = -1
        else:
            left_capacity = bins[i] - item
            if left_capacity == 0:
                priorities[i] = 0
            else:
                utilization = item / bins[i]
                if utilization < 0.1:
                    priorities[i] = math.sqrt(1 / utilization)
                elif 0.1 <= utilization < 0.3:
                    priorities[i] = 2 / (1 + utilization)
                elif 0.3 <= utilization < 0.5:
                    priorities[i] = 3 * utilization
                elif 0.5 <= utilization < 0.7:
                    priorities[i] = 4 * (1 - utilization)
                elif 0.7 <= utilization <= 1.0:
                    priorities[i] = 5 * utilization ** 2

    return priorities
